  true,\n\t\"url\": null,\n\t\"notes\": \"The Pasadena data environment covers the
  diverse roadway network in and around the City of Pasadena, California. The data
  was collected in 2011 during the months of September and October. The data environment
  includes a variety of data sets including network data (highway network file), demand
  data (trip tables), network performance data (link volumes, turn volumes, speeds
  and capacity), work zone data, weather data, Closed Circuit Television (CCTV) camera
  data, and Changeable Message Sign (CMS) data. Data from simulations are included
  where there are no sensors, and to provide forecasts.\",\n\t\"license_title\": \"Other
